import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/HomePage.css';  // Import CSS file

const HomePage = () => {
  return (
    <div>
      <header>
        <div>
          <Link to="/login">Login</Link>
          <Link to="/register">Register</Link>
        </div>
      </header>
      <main>
        <h1>Welcome to cho</h1>
        <h2>Information about the e-commerce website.</h2>
        <p>Chocolate is one of the most popular food types and flavors in the world, and many foodstuffs involving chocolate exist, particularly desserts, including cakes, pudding, mousse, chocolate brownies, and chocolate chip cookies. Many candies are filled with or coated with sweetened chocolate.</p>
      </main>
    </div>
  );
};

export default HomePage;
